import React from 'react';
import {List, Datagrid, TextField, EditButton, ReferenceField, Edit, SimpleForm, ReferenceInput, SelectInput, TextInput, Create} from 'react-admin';

export const PendaftaranList = props => (
    <List {...props} title="Pendaftaran Pasien">
        <Datagrid>
            <ReferenceField source="pasienId" reference="pasien"><TextField label="Nama" source="nama" /></ReferenceField>
            <TextField source="nomorUrut" />
            <TextField source="biaya" />
            <ReferenceField source="dokterId" reference="dokter"><TextField label="Nama" source="nama" /></ReferenceField>
            <EditButton />
        </Datagrid>
    </List>
);

export const PendaftaranEdit = props => (
    <Edit {...props}>
        <SimpleForm>
            <TextInput disabled source="id"/>
            <ReferenceInput source="pasienId" reference="pasien"><SelectInput optionText="nama" /></ReferenceInput>
            <TextInput source="nomorUrut" />
            <TextInput source="biaya" />
            <ReferenceField source="dokterId" reference="dokter"><TextField label="Nama" source="nama" /></ReferenceField>
        </SimpleForm>
    </Edit>
);

export const PendaftaranCreate = props => (
    <Create {...props}>
        <SimpleForm>
            <ReferenceInput source="pasienId" reference="pasien"><SelectInput optionText="nama" /></ReferenceInput>

            <TextInput source="nomorUrut" />
            <TextInput source="biaya" />
            <ReferenceField source="dokterId" reference="dokter"><TextField label="Nama" source="nama" /></ReferenceField>
        </SimpleForm>
    </Create>
);
